-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `login_name` varchar(64) NOT NULL COMMENT '',
  `name` varchar(64) NOT NULL COMMENT '',
  `password` varchar(64) NOT NULL COMMENT '',
  `sex` tinyint(2) NOT NULL DEFAULT '0' COMMENT '',
  `age` tinyint(2) DEFAULT '0' COMMENT '',
  `phone` varchar(20) DEFAULT NULL COMMENT '',
  `user_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '',
  `organization_id` int(11) NOT NULL DEFAULT '0' COMMENT '',
  `create_time` datetime NOT NULL COMMENT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COMMENT='';

